import React from 'react'

function InfoOfDataElement(props) {
  return (
    <div>
      <h1>{props.exercise.name}</h1>
      <h2>{props.exercise.description}</h2>
      <video src={props.exercise.video} />
    </div>
  )
}

export default InfoOfDataElement
